        return (
            <div>
                <ul>
                <li><a href="/">Twitter</a></li>
                <li><a href="/">Zuri Team</a></li>
                <li><a href="/">Zuri Books</a></li>
                <li><a href="/">Python Books</a></li>
                <li><a href="/">Background Check For Codes</a></li>
                <li><a href="/">Design Books</a></li>
            </ul>
            </div>
        );
    }
}
 
export default Linker;
